import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Header = styled.div`
  height: 80px;
  width: 100%;
  position: absolute;
  top: 0px;
  display: flex;
  z-index: 100;
  align-items: center;
  justify-content: space-between;
  max-width: 1440px;
`;

function Navigation() {
  return (
    <Header className>
      <div>Noah Jung</div>
      {/* <Naviagtion> */}
      <Link to="/">About</Link>
      <Link to="/">Work</Link>
      {/* </Naviagtion> */}
    </Header>
  );
}

export default Navigation;
